import React from "react";
import Link from "next/link";

export default function contact() {
  return (
    <div className="container">
      <header>
        <style jsx>
          {`
            ul {
              list-style-type: none;
              margin-right: 2rem;
            }

            a {
              float: right;
              color: white;
              text-align: center;
              padding: 10px;
              text-decoration: none;
              font-size: 20px;
              line-height: 35px;
              border-radius: 4px;
              display: block;
              font-family: "Roboto", sans-;
            }

            header {
              overflow: hidden;
              background-color: red;
              position: fixed;
              top: 0;
              width: 100%;
              float: right;
              padding: 5px 5px;
            }
          `}
        </style>
        <nav>
          <ul>
            <Link href="/contact">
              <a>Contact</a>
            </Link>
            <Link href="/projects">
              <a>Projects</a>
            </Link>
            <Link href="/about">
              <a>About Me</a>
            </Link>
            <Link href="/">
              <a>Home</a>
            </Link>
          </ul>
        </nav>
      </header>
      <div className="flex-container2">
        <div className="flex-item-left2" id="projects">
          <div className="project-tile">
            <h4>Javascript Calculator</h4>

            <p className="">

              I created this calculator with vanilla JavaScript, HTML and CSS
              for my task during my bootstrap with hyperionDev{" "}
            </p>

            <a
              href="https://testcalculator.netlify.app/"
              className="button button2"
              target="blank"
            >
              Click Here
            </a>
          </div>
        </div>

        <div className="flex-item-right2">
          <div className="project-tile2">
            <h4> Online Store</h4>

            <p className="">

              This is a online store with add to cart functionality, you can add
              items to cart and remove it at will.
            </p>

            <a
              href="https://testonlinestore.netlify.app/"
              className="button button1"
              target="blank"
            >
              Click Here
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}
